1	4	en	Do you offer one-time engagements?	Yes  convert any plan into a fixed-scope project. Pricing is based on scope and timeline.
2	4	fr	Proposez-vous des missions ponctuelles ?	Oui  transformez nimporte quel forfait en un projet  primtre dfini. La tarification dpend du primtre et du calendrier.
3	4	de	Bieten Sie einmalige Projekte an?	Ja  wandeln Sie jeden Plan in ein Projekt mit festem Umfang um. Die Preisgestaltung richtet sich nach Umfang und Zeitplan.
4	4	es	Ofrecen proyectos de una sola vez?	S  convierte cualquier plan en un proyecto de alcance definido. El precio se basa en el alcance y el cronograma.
5	5	en	Can we switch plans later?	Absolutely. Upgrade or downgrade anytime; unused time is prorated.
6	5	fr	Pouvons-nous changer de forfait plus tard ?	Absolument. Surclassez ou rtrogradez  tout moment ; le temps non utilis est calcul au prorata.
7	5	de	Knnen wir spter den Plan wechseln?	Natrlich. Upgrade oder Downgrade jederzeit; ungenutzte Zeit wird anteilig berechnet.
8	5	es	Podemos cambiar de plan ms adelante?	Por supuesto. Mejora o baja de plan en cualquier momento; el tiempo no utilizado se prorratea.
9	6	en	Whats the difference between Pro and Enterprise?	Pro is optimized for one team with a fast pilot and training. Enterprise includes cross-functional rollout support, governance, and security reviews.
10	6	es	Cul es la diferencia entre Pro y Enterprise?	Pro est optimizado para un solo equipo con un piloto rpido y capacitacin. Enterprise incluye soporte para la implementacin multifuncional, gobernanza y revisiones de seguridad.
11	6	fr	Quelle est la diffrence entre Pro et Enterprise ?	Pro est optimis pour une seule quipe avec un pilote rapide et une formation. Enterprise comprend un accompagnement au dploiement interfonctionnel, ainsi que la gouvernance et les revues de scurit.
12	6	de	Was ist der Unterschied zwischen Pro und Enterprise?	Pro ist fr ein einzelnes Team mit einem schnellen Pilotprojekt und Schulungen optimiert. Enterprise umfasst Untersttzung bei funktionsbergreifenden Rollouts, Governance und Sicherheitsprfungen.
\.
